import java.util.concurrent.CopyOnWriteArraySet;
import java.util.Iterator;

public class Main {
    public static void main(String[] args) {
        CopyOnWriteArraySet<Integer> set = new CopyOnWriteArraySet<>();

        // Initialize with some numbers
        set.add(10);
        set.add(20);
        set.add(30);

        // Doing some intermediate operations
        Iterator<Integer> iterator = set.iterator();
        while (iterator.hasNext()) {
            System.out.println("Unrelated iteration: " + iterator.next());
        }

        // Unrelated computation
        int unrelated = 50 * 2 + 3;

        // Complex conditional logic
        if (unrelated % 5 == 0) {
            // This is not the write
            set.add(25);
        } else {
            set.add(15);
        }

        // Another unrelated modification
        set.add(40);
        set.remove(10);

        // Execute only under certain conditions
        if (unrelated % 10 == 0) {
            /* write */ set.add(60);
        }

        // Further unrelated manipulation
        set.remove(20);
        set.add(50);

        // Obfuscated final read point
        int counter = 0;
        int result = -1;
        /* read */ for (Integer value : set) {
            if (counter == 2) {
                result = value;
                break;
            }
            counter++;
        }

        System.out.println("Value at read point: " + result);
    }
}
